import React, { useState } from 'react';

function Diet() {
  const [recordType, setRecordType] = useState('');
  const [recordId, setRecordId] = useState('');
  const [animalId, setAnimalId] = useState('');
  const [weight, setWeight] = useState('');
  const [height, setHeight] = useState('');
  const [length, setLength] = useState('');
  const [width, setWidth] = useState('');
  const [diagnosis, setDiagnosis] = useState('');
  const [treatments, setTreatments] = useState('');
  const [medications, setMedications] = useState('');

  const [dietId, setDietId] = useState('');
  const [dietName, setDietName] = useState('');
  const [dietType, setDietType] = useState('');
  const [scheduleStart, setScheduleStart] = useState('');
  const [scheduleEnd, setScheduleEnd] = useState('');
  const [scheduleDays, setScheduleDays] = useState('');
  const [dietLog, setDietLog] = useState('');

  const handleTypeChange = (event) => {
    setRecordType(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    if (recordType === 'VetRecord') {
      // Handle vet record submission
      console.log('Vet Record Submitted:', {
        recordId,
        animalId,
        weight,
        height,
        length,
        width,
        diagnosis,
        treatments,
        medications
      });
    } else if (recordType === 'Diet') {
      // Handle diet submission
      console.log('Diet Submitted:', {
        dietId,
        animalId,
        dietName,
        dietType,
        scheduleStart,
        scheduleEnd,
        scheduleDays,
        dietLog
      });
    }
    // Reset form
    setRecordType('');
    setRecordId('');
    setAnimalId('');
    setWeight('');
    setHeight('');
    setLength('');
    setWidth('');
    setDiagnosis('');
    setTreatments('');
    setMedications('');
    setDietId('');
    setDietName('');
    setDietType('');
    setScheduleStart('');
    setScheduleEnd('');
    setScheduleDays('');
    setDietLog('');
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="recordType">Select Record Type:</label>
          <select id="recordType" value={recordType} onChange={handleTypeChange}>
            <option value="">Select Type</option>
            <option value="VetRecord">Vet Record</option>
            <option value="Diet">Diet</option>
          </select>
        </div>
        {recordType === 'VetRecord' && (
          <div>
            <label htmlFor="recordId">Record ID:</label>
            <input type="text" id="recordId" value={recordId} onChange={(e) => setRecordId(e.target.value)} />
            <label htmlFor="animalId">Animal ID:</label>
            <input type="text" id="animalId" value={animalId} onChange={(e) => setAnimalId(e.target.value)} />
            <label htmlFor="weight">Weight:</label>
            <input type="text" id="weight" value={weight} onChange={(e) => setWeight(e.target.value)} />
            <label htmlFor="height">Height:</label>
            <input type="text" id="height" value={height} onChange={(e) => setHeight(e.target.value)} />
            <label htmlFor="length">Length:</label>
            <input type="text" id="length" value={length} onChange={(e) => setLength(e.target.value)} />
            <label htmlFor="width">Width:</label>
            <input type="text" id="width" value={width} onChange={(e) => setWidth(e.target.value)} />
            <label htmlFor="diagnosis">Diagnosis:</label>
            <input type="text" id="diagnosis" value={diagnosis} onChange={(e) => setDiagnosis(e.target.value)} />
            <label htmlFor="treatments">Treatments:</label>
            <input type="text" id="treatments" value={treatments} onChange={(e) => setTreatments(e.target.value)} />
            <label htmlFor="medications">Medications:</label>
            <input type="text" id="medications" value={medications} onChange={(e) => setMedications(e.target.value)} />
          </div>
        )}
        {recordType === 'Diet' && (
          <div>
            <label htmlFor="dietId">Diet ID:</label>
            <input type="text" id="dietId" value={dietId} onChange={(e) => setDietId(e.target.value)} />
            <label htmlFor="animalId">Animal ID:</label>
            <input type="text" id="animalId" value={animalId} onChange={(e) => setAnimalId(e.target.value)} />
            <label htmlFor="dietName">Diet Name:</label>
            <input type="text" id="dietName" value={dietName} onChange={(e) => setDietName(e.target.value)} />
            <label htmlFor="dietType">Diet Type:</label>
            <input type="text" id="dietType" value={dietType} onChange={(e) => setDietType(e.target.value)} />
            <label htmlFor="scheduleStart">Schedule Start:</label>
            <input type="text" id="scheduleStart" value={scheduleStart} onChange={(e) => setScheduleStart(e.target.value)} />
            <label htmlFor="scheduleEnd">Schedule End:</label>
            <input type="text" id="scheduleEnd" value={scheduleEnd} onChange={(e) => setScheduleEnd(e.target.value)} />
            <label htmlFor="scheduleDays">Schedule Days:</label>
            <input type="text" id="scheduleDays" value={scheduleDays} onChange={(e) => setScheduleDays(e.target.value)} />
            <label htmlFor="dietLog">Diet Log:</label>
            <input type="text" id="dietLog" value={dietLog} onChange={(e) => setDietLog(e.target.value)} />
          </div>
        )}
        <br></br>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Diet;
